import React from 'react';

const Home = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-4xl font-bold text-gray-800 mb-8">Welcome to Lost & Found</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-2xl font-semibold mb-4">Report Lost Item</h2>
          <p className="text-gray-600">Report an item you've lost</p>
        </div>
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-2xl font-semibold mb-4">Report Found Item</h2>
          <p className="text-gray-600">Report an item you've found</p>
        </div>
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-2xl font-semibold mb-4">My Reports</h2>
          <p className="text-gray-600">View your reported items</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
